import React, { Component } from 'react'
import Card from 'react-bootstrap/Card'
import ButtonGroup from 'react-bootstrap/ButtonGroup'
import Button from 'react-bootstrap/Button'
import Image from 'react-bootstrap/Image'
import Container from 'react-bootstrap/Container'

import './LoginForm.css'
export class ResearchCard extends Component {

    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div class="wrapper wrapper--w720">
                <Container>
                <Image src='hello-world/src/Images/Rohith.JPG' thumbnail />
                    <h4>{this.props.details.author}</h4>
                </Container>
               <Card bg='secondary'>
                    <Card.Header>
                        {this.props.details.author}
                        <br/>
                        {this.props.details.title} 
                    </Card.Header>
                    <Card.Body>
                        {this.props.details.abstract}
                        <div>
                            <ButtonGroup>
                                <Button variant='primary'>Like</Button>
                                <Button variant='dark'>Views</Button>
                            </ButtonGroup>
                        </div>
                        </Card.Body> 
                    </Card>
            </div>
        )
    }
}

export default ResearchCard
